import React, { useState } from 'react';

const App = () => {

    const [name, setname] = useState("");

    const text = (mern) => {
        setname(mern.target.value);
        
    }

   return(
    <>
    <div>
    <h1>Hello {name}</h1>
    <input type='text' placeholder='Enter Your Name' onChange={text}/>
    <button>Click Me</button>
    </div>
    </>
   );
};
export default App;
